import "./style.css";
import { ButtonComponent } from "../Button/index";
const Bold = () => {
  return (
    <section>
      <h2>Bold Originals & Big Hit Movies</h2>
      <h4>Don't Miss A Moment Of The Action</h4>
      <ButtonComponent value="IButton" />
    </section>
  );
};
export default Bold;
